import { useState, useEffect } from "react";

export default function Cars() {
  const [cars, setCars] = useState([]);
  useEffect(() => {
    const getCars = async () => {
        try {
            const res = await fetch('api/cars');
            const data = await res.json();
            setCars(data.cars);
        } catch(err) {
            throw new Error('Something went wrong');
        }
    }
  });
  return (
    <h1>Hello</h1>
  );
};
